import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom'; // Si vous utilisez React Router
import App from './App'; // Assurez-vous que le chemin est correct
import './index.css'; // Votre feuille de style globale (si elle existe)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>
);
